server:
  port: 8080
  servlet:
    context-path: /v1.0/
spring:
  application:
    name: app-tra-documents-service-api
    version: develop
  sleuth:
     sampler:
        probability: 1
  datasource:
    url: jdbc:h2:mem:testdb
    username: sa
    password: password
    driverClassName: org.h2.Driver
  jpa:
    database-platform: org.hibernate.dialect.H2Dialect
    defer-datasource-initialization: true
    schema: classpath:data.sql
---
server:
  port: ${PORT}
  servlet:
    context-path: /v1.0/
spring:
  profiles: release
  application:
    name: app-tra-documents-service-api
    version: ${APP_VERSION}
  sleuth:
     sampler:
        probability: 1
  datasource:
    url: ${SQL_URL_CONECTION}
    username: ${SQL_USERNAME}
    password: ${SQL_PASSWORD}
    driverClassName: org.h2.Driver
  jpa:
    database-platform: org.hibernate.dialect.H2Dialect
    defer-datasource-initialization: true
document:
  default: 
 